
package org.openapitools.client.model


case class RealtimeResponse (
    /* The unique ID of the response. */
    _id: Option[String],
    /* The object type, must be `realtime.response`. */
    _object: Option[String],
    /* The final status of the response (`completed`, `cancelled`, `failed`, or  `incomplete`).  */
    _status: Option[String],
    _statusDetails: Option[RealtimeResponseStatusDetails],
    /* The list of output items generated by the response. */
    _output: Option[List[RealtimeConversationItem]],
    /* Developer-provided string key-value pairs associated with this response.  */
    _metadata: Option[Any],
    _usage: Option[RealtimeResponseUsage]
)
object RealtimeResponse {
    def toStringBody(var_id: Object, var_object: Object, var_status: Object, var_statusDetails: Object, var_output: Object, var_metadata: Object, var_usage: Object) =
        s"""
        | {
        | "id":$var_id,"object":$var_object,"status":$var_status,"statusDetails":$var_statusDetails,"output":$var_output,"metadata":$var_metadata,"usage":$var_usage
        | }
        """.stripMargin
}
